pragma solidity ^0.8.4;

interface  i1155 {

    function fire(address caller_) external pure returns(uint256[] memory,uint256[] memory,uint256,bool,bool,uint256);
    function getfee(string memory fee_) external pure returns(uint256);
    function gflame(string memory flame_) external pure returns(address);
    function getContract(address caller_) external pure returns(bool);
    function _ipfs(uint256 nftea_) external pure returns(string memory);
    function _nftea2wallet(uint256 nftea) external pure returns(address);

}
contract mintstorage{

    using SafeMath for uint256;
    event wrapped(
        address wrapcontract,
        uint256 nftea,
        uint256 wrapped2,
        address wrappedby
    );
    struct NFTEA {

        uint256 nftea;
        address[] addresses;
        uint256[] settings;

    }
    NFTEA[] public _nfteas;

    string public name = "MINT STORAGE V1";
    mapping(uint256=>NFTEA) public _nftea;
    mapping(uint256=>string) public _nftea2label;
    mapping(string=>uint256) public _label2nftea;
    mapping(address=>uint256[]) public _owner2labels;
    mapping(address=>mapping(uint256=>uint256)) public _owner2labelsx;
    mapping(string=>uint256) public _label2premiumprice;
    mapping(uint256=>uint256[]) public _label2leaves;
    mapping(uint256=>mapping(uint256=>uint256)) public _label2leavesx;
    mapping(uint256=>string[]) public _nftea2mediaattributes;
    mapping(uint256=>string[]) public _nftea2mediatitle;
    mapping(uint256=>mapping(string=>uint256)) public _nftea2mediaattributesx;
    mapping(address=>uint256) public _contract2label;
    mapping(address=>uint256[]) public _contract2wraps;
    mapping(address=>mapping(uint256=>uint256)) public _contract2wrapsx;
    mapping(uint256=>uint256[]) public _nftea2wraps;
    mapping(uint256=>mapping(uint256=>uint256)) public _nftea2wrapsx;

    address public _burn = 0x000000000000000000000000000000000000dEaD;

    address public _fire;
    constructor(address fire_){
        _fire = fire_;
    }
    function checkLabel(address contract_) internal view returns(uint256,bool){
      uint256 burned = 0;
      bool expired = false;
      if(contract_!=address(0)){
        uint256 labelx_ = _contract2label[contract_];
        if(labelx_!=0){
          (address mint_) = i1155(_fire).gflame('mintcontract');
          (uint256 burnedx) = IERC1155(mint_).balanceOf(_burn,labelx_);
          burned = burnedx;
          uint256 expiredx = _nftea[labelx_].settings[7];
          expiredx = expiredx + 1 * 7 days;
          if(block.timestamp>expiredx){
            expired = true;
          }
        }
      }
      return(burned,expired);
    }
    function save(uint256 nftea_, address[] memory addresses_,uint256[] memory settings_, string memory label_) internal returns(bool){
        (address mint_) = i1155(_fire).gflame('mintcontract');
        if(settings_[3]!=11 && addresses_[4]!=address(0) && addresses_[4]!=mint_){

          (uint256 burned, bool expired) = checkLabel(addresses_[4]);
          require(_contract2label[addresses_[4]]==0 || burned>0 || expired, 'contract already linked to label');
        }
        if(settings_[0]>0 && settings_[6]>1){
            addresses_[2] = _nftea[settings_[0]].addresses[2];
        }
        if(addresses_[4]!=address(0) && addresses_[4]!=mint_ && settings_[3]==11){
          //wrapped nftea link to nftcontract
          settings_[0] = _contract2label[addresses_[4]];
          _contract2wraps[addresses_[4]].push(nftea_);
          _contract2wrapsx[addresses_[4]][nftea_] = _contract2wraps[addresses_[4]].length - 1;
        }
        if(settings_[3]==11 && addresses_[4]==mint_){
          _nftea2wraps[settings_[10]].push(nftea_);
          _nftea2wrapsx[settings_[10]][nftea_] = _nftea2wraps[settings_[10]].length - 1;

        }
        // addresses[creator,wallet,minter,labelowner]
        NFTEA memory save_ = NFTEA({
            nftea: nftea_,
            addresses: new address[](addresses_.length),
            settings: new uint[](settings_.length)
        });
        _nftea[nftea_] = save_;
        _nftea[nftea_].addresses = addresses_;
        _nftea[nftea_].settings = settings_;
        uint256 uselabelnftea_ = settings_[0];

        if(settings_[0]==0 && settings_[6]==1){
            uselabelnftea_ = nftea_;
        }
        if(settings_[3]>0 && settings_[3]<7){

            _nftea[nftea_].settings[7] = block.timestamp + settings_[1] * 365 days;
            _nftea[nftea_].addresses[3] = addresses_[0]; //set label creator
            _label2nftea[label_] = nftea_;
            _nftea2label[nftea_] = label_;
            _owner2labels[addresses_[0]].push(nftea_);
            _owner2labelsx[addresses_[0]][nftea_] = _owner2labels[addresses_[0]].length - 1;
            if(addresses_[4]!=address(0) && addresses_[4]!=mint_){
              _contract2label[addresses_[4]] = nftea_;
            }
        }
        if(settings_[0]>0 && settings_[3]!=11){
            _label2leaves[settings_[0]].push(nftea_);
            _label2leavesx[settings_[0]][nftea_] = _label2leaves[settings_[0]].length - 1;
        }
        if(settings_[3]==11){
          emit wrapped(addresses_[4], settings_[10], nftea_, addresses_[0]);

        }

    return true;
    }
    function unWrap(uint256 nftea_, address contract_) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not valid caller');

      (address mint_) = i1155(_fire).gflame('mintcontract');
      if(contract_==mint_){
        uint256 wrappedTo = _nftea[nftea_].settings[10];
        _nftea2wraps[wrappedTo][_nftea2wrapsx[wrappedTo][nftea_]] = _nftea2wraps[wrappedTo].length - 1;
        _nftea2wraps[wrappedTo].pop();
      }else{
        _contract2wraps[contract_][_contract2wrapsx[contract_][nftea_]] = _contract2wraps[contract_].length - 1;
        _contract2wraps[contract_].pop();
      }
      return true;
    }
    function setmint(uint256 nftea_,address[] memory addresses_,uint256[] memory settings_, string memory label_) external returns(bool) {
        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not valid caller');
        (success) = save(nftea_, addresses_, settings_, label_);
        return success;
    }
    function setrenew(uint256 nftea_,uint256 expire_) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not valid caller');
      _nftea[nftea_].settings[1] = expire_;
      _nftea[nftea_].settings[7] = block.timestamp + expire_ * 365 days;
      return true;
    }

    function setmediaattribute(uint256 nftea_, string memory media_, string memory title_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not valid caller');

        _nftea2mediaattributes[nftea_].push(media_);
        _nftea2mediatitle[nftea_].push(title_);
        _nftea2mediaattributesx[nftea_][media_] = _nftea2mediaattributes[nftea_].length - 1;

        return true;
    }
    function removemediaattribute(uint256 nftea_, string memory media_) public{
        (address flame_) = i1155(_fire).gflame('mintcontract');
        require(IERC1155(flame_).balanceOf(msg.sender,nftea_)>0, 'you do not own this nftea');
        _nftea2mediaattributes[nftea_][_nftea2mediaattributesx[nftea_][media_]] = _nftea2mediaattributes[nftea_][_nftea2mediaattributes[nftea_].length-1];
        _nftea2mediatitle[nftea_][_nftea2mediaattributesx[nftea_][media_]] = _nftea2mediatitle[nftea_][_nftea2mediatitle[nftea_].length-1];

    }
    function getnftea(uint256 nftea_) public view returns(NFTEA memory, string[] memory, string memory){

        return(_nftea[nftea_], _nftea2mediaattributes[nftea_], _nftea2label[nftea_]);
    }
    function getmediaattributes(uint256 nftea_) public view returns(string[] memory, string[] memory) {

        return (_nftea2mediaattributes[nftea_], _nftea2mediatitle[nftea_]);
    }
    function getnftea2label(uint256 nftea_) public view returns(uint256, uint256){

        return (_nftea[nftea_].settings[0], _nftea[nftea_].settings[7]);
    }
    function getlabel(uint256 nftea_, string memory label_) public view returns(NFTEA memory, uint256[] memory, string memory, bool){

        if(nftea_<1){
            nftea_ = _label2nftea[label_];
        }
        bool burned = false;
        if(nftea_>0){
          (address flame_) = i1155(_fire).gflame('mintcontract');
          IERC1155 nft = IERC1155(flame_);
          if(nft.balanceOf(_burn, nftea_)==_nftea[nftea_].settings[6]){
            burned = true;
          }
        }
        return(_nftea[nftea_],_label2leaves[nftea_],_nftea2label[nftea_],burned);
    }
    function getlabelprice(string memory label_) public view returns(uint256, uint256){

        (uint256 price_) = i1155(_fire).getfee('label');
        return (price_, _label2premiumprice[label_]);
    }
    function getownerlabels(address owner_) public view returns(uint256[] memory){

        return _owner2labels[owner_];
    }

    function getlabelsearch(string memory label_) public view returns(uint256){

        return _label2nftea[label_];
    }
    function getcontractwraps(address contract_)public view returns(uint256[] memory,uint256[] memory,uint256[] memory, string[] memory){
      string[] memory ipfs_ = new string[](_contract2wraps[contract_].length);
      uint256[] memory bnb_ = new uint256[](_contract2wraps[contract_].length);
      uint256[] memory balance_ = new uint256[](_contract2wraps[contract_].length);
      uint256[] memory nftea_ = new uint256[](_contract2wraps[contract_].length);

      (address tea_) = i1155(_fire).gflame('teatoken');
      (address mint_) = i1155(_fire).gflame('mintcontract');

      for (uint256 i = 0; i < _contract2wraps[contract_].length; ++i) {
        nftea_[i] = _contract2wraps[contract_][i];
        ipfs_[i] = i1155(mint_)._ipfs(nftea_[i]);
        address wallet_ = i1155(mint_)._nftea2wallet(nftea_[i]);
        balance_[i] = IERC20(tea_).balanceOf(wallet_);
        bnb_[i] = wallet_.balance;
      }
      return(nftea_,balance_,bnb_,ipfs_);
    }
    function getnftwraps(uint256 nftea_)public view returns(uint256[] memory,uint256[] memory,uint256[] memory, string[] memory){
      string[] memory ipfs_ = new string[](_nftea2wraps[nftea_].length);
      uint256[] memory bnb_ = new uint256[](_nftea2wraps[nftea_].length);
      uint256[] memory balance_ = new uint256[](_nftea2wraps[nftea_].length);
      uint256[] memory nfteas_ = new uint256[](_nftea2wraps[nftea_].length);

      (address tea_) = i1155(_fire).gflame('teatoken');
      (address mint_) = i1155(_fire).gflame('mintcontract');

      for (uint256 i = 0; i < _nftea2wraps[nftea_].length; ++i) {
        nfteas_[i] = _nftea2wraps[nftea_][i];
        ipfs_[i] = i1155(mint_)._ipfs(nfteas_[i]);
        address wallet_ = i1155(mint_)._nftea2wallet(nfteas_[i]);
        balance_[i] = IERC20(tea_).balanceOf(wallet_);
        bnb_[i] = wallet_.balance;

      }
      return(nfteas_,balance_,bnb_,ipfs_);
    }
    function updateWrapLinkTo(uint256 nftea_, address contract_) public {

      (address mint_) = i1155(_fire).gflame('mintcontract');
      if(contract_!=address(0)){

        uint256 newlinkTo = _contract2label[contract_];
        require(_nftea[nftea_].addresses[4]==contract_, 'wrong contract');
        require(newlinkTo>0, 'contract not linked to label');
        uint256 balance = IERC1155(mint_).balanceOf(msg.sender,nftea_);
        require(balance>0, 'you do not own this nftea');
        _nftea[nftea_].settings[0] = newlinkTo;

      }else{

        uint256 linkTo = _nftea[nftea_].settings[0];
        uint256 expired = _nftea[linkTo].settings[7];
        expired = block.timestamp + 1 * 7 days;
        uint256 burned = IERC1155(mint_).balanceOf(_burn,linkTo);

        require(burned>0 || block.timestamp>expired, 'label still active');
        string memory label = _nftea2label[linkTo];
        uint256 newLinkTo = _label2nftea[label];
        require(newLinkTo>0, 'label not registered');
        _nftea[nftea_].settings[0] = newLinkTo;

      }

    }
      function updateLinkedTo(uint256 nftea_, uint256 linkedto_) public {
        require(nftea_>0 && linkedto_>0, 'error');
        (address mint_) = i1155(_fire).gflame('mintcontract');
        uint256 balance1 = IERC1155(mint_).balanceOf(msg.sender,nftea_);
        uint256 balance2 = IERC1155(mint_).balanceOf(msg.sender,linkedto_);
        require(balance1>0 && balance2>0 && _nftea[linkedto_].settings[3]<7 && (_nftea[linkedto_].addresses[0]==msg.sender && _nftea[nftea_].addresses[0]==msg.sender || _nftea[linkedto_].addresses[1]==msg.sender && _nftea[nftea_].addresses[1]==msg.sender));
        if(_nftea[nftea_].settings[0]>0){
          _label2leaves[_nftea[nftea_].settings[0]][_label2leavesx[_nftea[nftea_].settings[0]][nftea_]] = _label2leaves[_nftea[nftea_].settings[0]].length - 1;
          _label2leaves[_nftea[nftea_].settings[0]].pop();
        }
        _label2leaves[linkedto_].push(nftea_);
        _label2leavesx[linkedto_][nftea_] = _label2leaves[linkedto_].length - 1;
        _nftea[nftea_].settings[0] = linkedto_;
      }

}
